import time
from heapq import heapify, heapreplace
from typing import List


# 1792. 最大平均通过率

# 一所学校里有一些班级，每个班级里有一些学生，现在每个班都会进行一场期末考试。给你一个二维数组 classes，其中classes[i] = [passi, totali]，表示你提前知道了第i个班级总共有totali个学生，其中只有passi个学生可以通过考试。
#
# 给你一个整数extraStudents，表示额外有extraStudents个聪明的学生，他们 一定能通过任何班级的期末考。你需要给这extraStudents个学生每人都安排一个班级，使得 所有班级的 平均通过率 最大。
#
# 一个班级的通过率等于这个班级通过考试的学生人数除以这个班级的总人数。平均通过率是所有班级的通过率之和除以班级数目。
#
# 请你返回在安排这 extraStudents 个学生去对应班级后的 最大平均通过率。与标准答案误差范围在10-5以内的结果都会视为正确结果。
# 示例 1：
#
# 输入：classes = [[1,2],[3,5],[2,2]], extraStudents = 2
# 输出：0.78333
# 解释：你可以将额外的两个学生都安排到第一个班级，平均通过率为 (3/4 + 3/5 + 2/2) / 3 = 0.78333 。
# 示例 2：
#
# 输入：classes = [[2,4],[3,9],[4,5],[2,10]], extraStudents = 4
# 输出：0.53485
#


class Solution:
    def maxAverageRatio(self, classes: List[List[int]], extraStudents: int) -> float:
        for i in range(extraStudents):
            increase = 0
            index = 0
            for j in range(len(classes)):
                cur_inc = (classes[j][0] + 1) / (classes[j][1] + 1) - classes[j][0] / classes[j][1]
                if cur_inc > increase:
                    index = j
                    increase = cur_inc
            classes[index][0] += 1
            classes[index][1] += 1
        return sum([classes[x][0] / classes[x][1] for x in range(len(classes))]) / len(classes)

    def maxAverageRatio1(self, classes: List[List[int]], extraStudents: int) -> float:
        indicate = []
        for i in range(len(classes)):
            a = (classes[i][1] - classes[i][0]) / (classes[i][1] + 1) / classes[i][1]
            indicate.append([i, a])
        indicate.sort(key=lambda x: x[1], reverse=True)

        for i in range(extraStudents):
            # print(classes[indicate[0][0]])
            classes[indicate[0][0]][0] += 1
            classes[indicate[0][0]][1] += 1
            a = [indicate[0][0],
                 (classes[indicate[0][0]][1] - classes[indicate[0][0]][0]) / (classes[indicate[0][0]][1] + 1) /
                 classes[indicate[0][0]][1]]
            del indicate[0]

            right = len(indicate) - 1
            left = 0
            while right >= left:
                index = (right - left) // 2 + left
                if indicate[index][1] > a[1]:
                    left = index + 1
                elif indicate[index][1] < a[1]:
                    right = index - 1
                else:
                    left = left + 1
            indicate.insert(left, a)

            # right = len(indicate) - 1
            # left = 0
            # if indicate[0][1] <= a[1]:
            #     indicate.insert(0, a)
            # else:
            #     index = (right - left) // 2
            #     while right >= left and index != left:
            #         if indicate[index][1] > a[1]:
            #             left = index
            #             index = left + (right - left) // 2
            #         elif indicate[index][1] < a[1]:
            #             right = index
            #             index = left + (right - left) // 2
            #         else:
            #             right = index
            #             left = index
            #     indicate.insert(right, a)
        return sum([classes[x][0] / classes[x][1] for x in range(len(classes))]) / len(classes)

    def maxAverageRatio2(self, classes: List[List[int]], extraStudents: int) -> float:
        h = [Entry(*c) for c in classes]
        heapify(h)
        for _ in range(extraStudents):
            # print([h[0].p, h[0].t])
            heapreplace(h, Entry(h[0].p + 1, h[0].t + 1))
        return sum(e.p / e.t for e in h) / len(h)


class Entry:
    __slots__ = 'p', 't'

    def __init__(self, p: int, t: int):
        self.p = p
        self.t = t

    def __lt__(self, b: 'Entry') -> bool:
        return (self.t - self.p) * b.t * (b.t + 1) > (b.t - b.p) * self.t * (self.t + 1)


